		#endregion Properties

		public override ValidationSummary Validate(Checkpoint entity)
		{
			var result = new ValidationSummary();
			
			if(entity.Route == null) throw new ValidationException(Resources.BusinessComponents.Checkpoint.RouteIsRequired);

			if (string.IsNullOrEmpty(entity.UUID)) throw new ValidationException(Resources.BusinessComponents.Checkpoint.UUIDIsRequired);

			if (entity.Coordinate == null) throw new ValidationException(Resources.BusinessComponents.Checkpoint.CoordinateIsRequired);

			if (entity.DateTime == DateTime.MinValue) throw new ValidationException(Resources.BusinessComponents.Checkpoint.DateIsRequired);

			return result;
		}

		public Checkpoint Add(Checkpoint checkpoint)
		{
			#region Validations

			if (checkpoint.Route == null) throw new ValidationException(Resources.BusinessComponents.Checkpoint.RouteIsRequired);

			#endregion Validations

			var route = RouteComponent.Instance.GetById(checkpoint.Route.ID);

			// process checkpoint to add more info
			checkpoint.NextStopIndex = RouteComponent.Instance.GetNextStop(route, checkpoint.Coordinate);

			// store checkpoint
			return Save(checkpoint);
		}

		public List<Checkpoint> GetByRoute(Route route, DateTime fromDate, DateTime toDate)
		{
			return ServiceLocator.Current.GetInstance<ICheckpointPersistence>().GetByRoute(route, fromDate, toDate);
		}

		#region Cache - Testing

		public Checkpoint AddToCache(Checkpoint checkpoint)
		{
			#region Validations

			if (string.IsNullOrEmpty(checkpoint.UUID)) throw new Exception("UUID field is required.");
			
			if (checkpoint.Route == null) throw new Exception("Route field is required.");
			
			if (checkpoint.Coordinate == null) throw new Exception("Coordinate field is required.");

			#endregion Validations

			// process checkpoint to add more info
			var route = RouteComponent.Instance.GetById(checkpoint.Route.ID);
			checkpoint.NextStopIndex = RouteComponent.Instance.GetNextStop(route, checkpoint.Coordinate);
			
			// store checkpoint
			if (!_checkpointStorage.ContainsKey(route.ID))
			{
				_checkpointStorage.Add(route.ID, new RouteCheckpoints(route));
			}

			_checkpointStorage[route.ID].Add(checkpoint);

			return checkpoint;
		}

		public void ClearCache()
		{
			_checkpointStorage.Clear();
		}
		
		public List<Checkpoint> GetByRouteFromCache(Route route)
		{
			if (route == null || !_checkpointStorage.ContainsKey(route.ID)) return new List<Checkpoint>();

			return _checkpointStorage[route.ID].GetAll();
		}
		
		public List<Checkpoint> GetByNextStopFromCache(int lineNumber, string branchCode, RouteDirection direction, int fromStopIndex, int toStopIndex)
		{
			Route route = RouteComponent.Instance.GetRoute(lineNumber, branchCode, direction);

			return GetByNextStopFromCache(route, fromStopIndex, toStopIndex);
		}
		
		public List<Checkpoint> GetByNextStopFromCache(Route route, int fromStopIndex, int toStopIndex)
		{
			var routeCheckpoints = GetByRouteFromCache(route);

			return routeCheckpoints.Where(c => c.NextStopIndex >= fromStopIndex && c.NextStopIndex <= toStopIndex).ToList();
		}

		public List<Checkpoint> GetByInformerFromCache(int lineNumber, string branchCode, RouteDirection direction, string uuid)
		{
			Route route = RouteComponent.Instance.GetRoute(lineNumber, branchCode, direction);

			return GetByInformerFromCache(route, uuid);
		}

		public List<Checkpoint> GetByInformerFromCache(Route route, string uuid)
		{
			var routeCheckpoints = GetByRouteFromCache(route);

			return routeCheckpoints.Where(c => c.UUID.Equals(uuid)).ToList();
		}
		
		#endregion Cache - Testing

